import { loginUserThunk } from './Redux/action'

function Dashboard() {
  return (
    <div>
      <button onClick={() => dispatch(loginUserThunk({ name: 'rizwan', email: 'khan@gmail.com' }))}>
       Menu List
      </button></div>
  )
}

export default Dashboard
